import React, { useState, useEffect } from 'react';
import { GET_BUSINESS_APP_INSTALLATION_VIA_CALL } from "../../apis/Apis";

const Business_app_installation_via_call = () => {
    const [data, setData] = useState(null);
    const [loading, setLoading] = useState(true);
    const [error, setError] = useState(null);
    const [status, setStatus] = useState('');

    const getData = async () => {
        try {
            setLoading(true);
            const res = await GET_BUSINESS_APP_INSTALLATION_VIA_CALL();

            if (res.status_code === 200) {
                setData(res.data);
                setError(null);
            } else {
                setError('Failed to fetch data');
            }
        } catch (error) {
            console.log(error);
            setError('An error occurred while fetching data');
        } finally {
            setLoading(false);
        }
    };

    useEffect(() => {
        getData();
    }, []);

    const handleStatusChange = (e) => {
        setStatus(e.target.value);
    };

    const handleSubmit = (e) => {
        e.preventDefault();
        console.log('Selected Status:', status);
        // Add your submit logic here
    };

    if (loading) {
        return (
            <div className="container mt-4">
                <div className="d-flex justify-content-center">
                    <div className="spinner-border" role="status">
                        <span className="visually-hidden">Loading...</span>
                    </div>
                </div>
            </div>
        );
    }

    if (error) {
        return (
            <div className="container mt-4">
                <div className="alert alert-danger" role="alert">
                    {error}
                </div>
            </div>
        );
    }

    return (
        <div className="container mt-4">
            <div className="row justify-content-center">
                <div className="col-lg-8">
                    <div className="card">
                        <div className="card-header">
                            <h4 className="mb-0">Business App Installation Details</h4>
                        </div>
                        <div className="card-body">
                            {data && (
                                <div>
                                    <div className="row">
                                        <div className="col-md-6 mb-3">
                                            <label className="form-label">Service Provider Mobile</label>
                                            <input 
                                                type="text" 
                                                className="form-control" 
                                                value={data.service_provider_mobile_number || ''} 
                                                readOnly 
                                            />
                                        </div>
                                        <div className="col-md-6 mb-3">
                                            <label className="form-label">Business Name</label>
                                            <input 
                                                type="text" 
                                                className="form-control" 
                                                value={data.business_name || ''} 
                                                readOnly 
                                            />
                                        </div>
                                    </div>

                                    <div className="row">
                                        <div className="col-12 mb-3">
                                            <label className="form-label">Business Address</label>
                                            <textarea 
                                                className="form-control" 
                                                rows="2"
                                                value={data.business_address || ''} 
                                                readOnly
                                            ></textarea>
                                        </div>
                                    </div>

                                    <div className="row">
                                        <div className="col-md-6 mb-3">
                                            <label className="form-label">Service Type</label>
                                            <input 
                                                type="text" 
                                                className="form-control" 
                                                value={data.service_type || ''} 
                                                readOnly 
                                            />
                                        </div>
                                        <div className="col-md-6 mb-3">
                                            <label className="form-label">Service Provider Type</label>
                                            <input 
                                                type="text" 
                                                className="form-control" 
                                                value={data.service_provider_type || ''} 
                                                readOnly 
                                            />
                                        </div>
                                    </div>

                                    <div className="row">
                                        <div className="col-md-6 mb-3">
                                            <label className="form-label">Registration Date</label>
                                            <input 
                                                type="text" 
                                                className="form-control" 
                                                value={data.registration_date || ''} 
                                                readOnly 
                                            />
                                        </div>
                                        <div className="col-md-6 mb-3">
                                            <label className="form-label">RM Call Later</label>
                                            <input 
                                                type="text" 
                                                className="form-control" 
                                                value={data.b_rm_call_later || ''} 
                                                readOnly 
                                            />
                                        </div>
                                    </div>

                                    <div className="row">
                                        <div className="col-md-6 mb-3">
                                            <label className="form-label">Status <span className="text-danger">*</span></label>
                                            <select 
                                                className="form-select" 
                                                value={status} 
                                                onChange={handleStatusChange}
                                                required
                                            >
                                                <option value="">Select Status</option>
                                                <option value="Discussed">Discussed</option>
                                                <option value="Not Responding">Not Responding</option>
                                                <option value="Call Later">Call Later</option>
                                                <option value="Not Interested">Not Interested</option>
                                            </select>
                                        </div>
                                    </div>

                                    <div className="row mt-3">
                                        <div className="col-12">
                                            <button type="button" className="btn btn-primary me-2" onClick={handleSubmit}>
                                                Update Status
                                            </button>
                                            <button type="button" className="btn btn-secondary" onClick={getData}>
                                                Refresh Data
                                            </button>
                                        </div>
                                    </div>
                                </div>
                            )}
                        </div>
                    </div>
                </div>
            </div>
        </div>
    );
};

export default Business_app_installation_via_call;
